import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import logo from './logo.svg';

function handleClickPortfolio () {
  ReactDOM.render(<App />, document.getElementById('root'));
}

function handleClickContacto () {
  ReactDOM.render(<App />, document.getElementById('root'));
}

function handleClickPrecios () {
  ReactDOM.render(<App />, document.getElementById('root'));
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <section className="App-logo">
        <img src={logo} alt="Acuarella Fotografia"></img>
        </section>
        <hgroup className="App-hgroup">
           <h1>Aquarella Fotografia</h1>
           <h3>By Noelia Abate</h3>
        </hgroup>
      </header>
      <nav className="App-menu">
          <ul>
            <li><a href={handleClickPortfolio}>Portfolio</a></li>
            <li><a href={handleClickContacto}>Contacto</a></li>
            <li><a href={handleClickPrecios}>Precios</a></li>
          </ul>
      </nav>
    </div>
  );
}

export default App;
